//import './App.css';
import Header from "./components/common/Header";
import { createMuiTheme, createTheme, ThemeProvider } from '@material-ui/core/styles';
//import { ThemeOptions } from '@material-ui/core/styles/createMuiTheme';
import backgroundImage from "./assets/images/backgroundMain.jpg"

export const themeOptions: any = {
  palette: {
    type: 'light',
    primary: {
      main: '#434858',
    },
    secondary: {
      main: '#f50057',
    },
  },
  spacing: [0, 4, 8, 16, 32, 64],
  overrides: {
    MuiAppBar: { 
      root: { 
        minHeight: "100px"
      },
    },
  },
};

function App() {

  const theme = createTheme(
    themeOptions
  );

  return (
    <ThemeProvider theme={theme}>

        <Header />
        <img src={backgroundImage} style={{ width: "100%",
          height: "100%",
          backgroundSize: "cover",}}/>
    </ThemeProvider>
  );
}

export default App;
